import React, { useEffect, useState } from "react";

const App = () => {
  const [apiMessage, setApiMessage] = useState("");

  useEffect(() => {
    fetch("http://localhost:3000/") // Backend URL
      .then(res => res.json())
      .then(data => setApiMessage(data.message))
      .catch(err => setApiMessage("Error: " + err.message));
  }, []);

  return (
    <div>
      <h1>Expense Tracker Frontend</h1>
      <p>Backend says: {apiMessage}</p>
    </div>
  );
};

export default App;
